import * as S from '../../styles/Routine/Routine.style';

function ExerciseCard({ id, type, part, name, duration, calories, openCard }) {
  return (
    <S.ExerciseCard openCard={openCard}>
      <div>{type}</div>
      <div>{part}</div>
      <div>{name}</div>
      <div>{duration}</div>
      <div>{calories}</div>
    </S.ExerciseCard> 
  )
}

export default ExerciseCard;
